import axios from "axios";


class WeatherMeta {
    constructor() {

        this.state = {
            woeid: null
        }

    }

    async getLocation(query) {
        let res = await axios.get(`https://www.metaweather.com/api/location/search/?query=${query}`)
        console.log(res);
    }

}

export default WeatherMeta;
